// components/Topbar.js
import React from "react";

const Topbar = () => {
  return (
    <div
      style={{
        width: "1275px",
        height: "85px",
        backgroundColor: "rgba(45, 47, 57, 0.60)",
        boxShadow: "0px 4px 4px rgba(0, 0, 0, 0.25)",
        borderRadius: "15px",
        overflow: "hidden",
        display: "flex",
        justifyContent: "center",
        alignItems: "flex-start",
      }}
    >
      <div
        style={{
          flex: "1 1 0",
          alignSelf: "stretch",
          padding: "26px 29px 26px 28px",
          justifyContent: "center",
          alignItems: "flex-start",
          gap: "50px",
          display: "flex",
        }}
      >
        {["About Me", "Projects", "Testimonials", "Get in Touch"].map(
          (item, index) => (
            <div
              key={index}
              style={{
                width: index < 2 ? "137px" : "205px",
                textAlign: "center",
                color: "rgba(56, 216, 126, 0.65)",
                fontSize: "28px",
                fontFamily: "Consolas, monospace",
                fontWeight: "700",
                wordWrap: "break-word",
              }}
            >
              {item}
            </div>
          )
        )}
      </div>
    </div>
  );
};

export default Topbar;
